import React from 'react';
import { useNavigate } from 'react-router-dom';
import { logout } from '../services/authService';

const Header = ({ onSearch }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <header className="flex flex-col sm:flex-row sm:justify-between items-center gap-3 p-4 bg-blue-600 text-white shadow-lg">
      <input
        type="text"
        placeholder="Search products..."
        className="rounded-lg p-2 text-black w-full sm:w-64 focus:outline-none focus:ring-2 focus:ring-white"
        onChange={e => onSearch(e.target.value)}
      />
      <button onClick={handleLogout} className="bg-red-500 hover:bg-red-600 transition px-4 py-2 rounded-lg font-semibold shadow">
        Logout
      </button>
    </header>
  );
};

export default Header;
